(function () {
  const pubsub = {
    events: {},
    subscribe: (eventName, functionName) => {
      pubsub["events"][eventName] = pubsub["events"][eventName] ?? [];
      pubsub["events"][eventName].push(functionName);
    },
    publish: (eventName, args) => {
      pubsub["events"][eventName].forEach((callbackFunction) => {
        callbackFunction(args);
      });
    },
    unsubscribe: (eventName, functionName) => {
      for (const i in pubsub["events"][eventName]) {
        if (pubsub["events"][eventName][i] === functionName) {
          pubsub["events"][eventName].splice(i, 1, 0);
        }
      }
    },
  };

  class Book {
    static library = !!localStorage.getItem("library")
      ? JSON.parse(localStorage.getItem("library"))
      : {
          "The song of ice and fire by George R. R. Martin": {
            details: {
              title: "The song of ice and fire",
              author: "George R. R. Martin",
              pages: "973",
              published: "8/1/1996",
              description:
                "A Song of Ice and Fire is a series of epic fantasy novels by the American novelist and screenwriter George R. R. Martin. He began the first volume of the series, A Game of Thrones, in 1991, and it was published in 1996",
              genres: ["Fantasy"],
              "cover-image":
                "data:image/jpeg;base64,",
              key: "The song of ice and fire by George R. R. Martin",
            },
          },
          "Fowers for Algernon by Daniel Keyes": {
            details: {
              title: "Fowers for Algernon",
              author: "Daniel Keyes",
              pages: "311",
              published: "4/1/1959",
              read: "book read",
              description:
                "Flowers for Algernon, by Daniel Keyes, tells the story of Charlie Gordon, a mentally disabled, middle-aged man who takes part in an experimental procedure aimed at increasing intelligence.",
              genres: ["Sci-fi"],
              "cover-image":
                "data:image/jpeg;base64,",
              key: "Fowers for Algernon by Daniel Keyes",
            },
          },
        };
    static updateLibrary = () => {
      localStorage.setItem("library", JSON.stringify(Book.library));
    };
    static initBooks = () => {
      for (const book in Book.library) {
        if (!book) continue;
        const details = Book.library[book].details;
        const image = details["cover-image"];
        pubsub.publish("createAnchor", [details, image]);
      }
    };
    static deleteBook = (key) => {
      delete this.library[key];
      Book.updateLibrary();
    };
    setImage = () => {
      queries.objects.reader.readAsDataURL(this.details["cover-image"]);
      queries.objects.reader.addEventListener("load", () => {
        this.details["cover-image"] = queries.objects.reader.result;
        Book.updateLibrary();
      });
    };
    details = {};
    get details() {
      return this.details;
    }
    getProperty(property) {
      return (this.details[property] = this.details[property] ?? false);
    }
    static setDetail = (array) => {
      const [key, obj] = array;
      console.dir(key, obj);
      const { name, value } = obj;
      Book.library[key].details[name] = value;
      Book.updateLibrary();
      if (name === "cover-image") this.setImage();
    };
    constructor(obj) {
      this.details = obj;
      const { title, author } = obj;
      if (!!this.details["cover-image"]) {
        this.setImage();
      }

      const key = (this.details.key = `${title} by ${author}`);
      Book.library[key] = Book.library[key] ?? this;
      Book.updateLibrary();
      document.location.reload();
    }
    delete = (key) => {
      delete library[key];
      Book.updateLibrary();
    };
  }
  const queries = {
    objects: {
      form: document.querySelector("form"),
      fileInput: document.querySelector('[type="file"]'),
      book: document.querySelector(".book"),
      coverImage: document.querySelector(".book .cover-image"),
      delete: document.querySelector(".delete"),
      library: document.querySelector(".library"),
      libraryAnchor: document.querySelector(`a[href="#library"]`),
      navAnchor: document.querySelector('a[href="#actions"]'),
      marker: document.querySelector(".mark"),
      reader: new FileReader(),
      bookSnapshot: document.querySelector(".book").cloneNode("true"),
    },
    markAsRead: (event) => {
      if (!(event.target === queries.objects.marker)) return;
      if ("read" in queries.objects.book.dataset) {
        delete queries.objects.book.dataset.read;
        queries.objects.book.querySelector(".read").textContent =
          "Book was marked as unread";
        pubsub.publish("setDetail", [
          queries.objects.book.id,
          {
            name: "read",
            value: "You haven't read this book yet",
          },
        ]);
        return;
      }
      queries.objects.book.dataset.read = "";
      pubsub.publish("setDetail", [
        queries.objects.book.id,
        {
          name: "read",
          value: "You've read this book",
        },
      ]);
      queries.objects.book.querySelector(".read").textContent =
        "Book was marked as read";
    },
    extractURL: () => {
      result = queries.objects.reader.result;
      return result;
    },
    getData: (event) => {
      event.preventDefault();
      const formData = new FormData(event.target);
      const fields = {};
      for (let [key, value] of formData) {
        if (value === "") continue;
        if (key === "genres") {
          console.trace(key);
          value = value.split(",");
          console.dir(value);
        }
        if (key === "published") {
          value = new Date(value).toLocaleDateString();
        }
        fields[key] = value;
      }
      const book = new Book(fields);
      queries.objects.form.reset();
    },
    fillBookdetails: (object, book) => {
      for (let [detail, value] of Object.entries(book)) {
        if (detail === "genres") {
          for (const i of value) {
            const genre = document.createElement("span");
            genre.classList.add("genre");
            genre.dataset.temp = "";
            genre.textContent = i.trim();
            object.querySelector(".genres").appendChild(genre);
          }
          continue;
        }
        try {
          const detailObj = object.querySelector(`.${detail}`);
          detailObj.textContent = value;
          detailObj.dataset.detail = detail;
        } catch (err) {
          console.error(detail);
        }
      }
    },
    editDetails: (event) => {
      const toEdit = event.target.parentElement.querySelector(".to-edit");
      if (
        event.target.matches(`.edit`) &&
        !toEdit.classList.contains("editing")
      ) {
        event.target.dataset.save = "";
        toEdit.setAttribute("contenteditable", "");
        toEdit.classList.add("editing");
        toEdit.focus();
        return;
      }
      if (event.target.matches("[data-save]")) {
        const key = event.target.closest(".book").id;
        // Book.library[key][toEdit.dataset.detail] = toEdit.textContent;
        const detail = toEdit.dataset.detail;
        console.dir(detail);
        console.dir(toEdit.textContent);

        pubsub.publish("setDetail", [
          key,
          {
            name: detail,
            value: toEdit.textContent,
          },
        ]);
        delete event.target.dataset.save;
        toEdit.classList.remove("editing");
      }
      if (event.target.matches(`.cancel`)) {
        toEdit.removeAttribute("contenteditable");
        toEdit.classList.remove("editing");
      }
    },
    createAnchor: (array) => {
      const [book, image] = array;
      const libraryAnchor = document.createElement("div");
      const libraryCover = queries.objects.book
        .querySelector(".cover")
        .cloneNode("true");
      libraryAnchor.title = book.key;
      libraryAnchor.appendChild(libraryCover);
      libraryAnchor.querySelector(".cover-title").textContent = "";
      libraryAnchor.querySelector("img").alt = libraryAnchor.querySelector(
        "img"
      ).title = book.key;
      libraryAnchor.querySelector("img").src = "";
      libraryAnchor.querySelector("img").src = `${image}`;

      queries.objects.library.appendChild(libraryAnchor);
      queries.objects.book.querySelector(".cover").title = `${book.key}`;
      libraryAnchor.addEventListener("click", () => {
        queries.createBook([book, `${book.key}`, image]);
        const a = document.createElement("a");
        a.href = `#${book.key}`;
        a.click();
        delete a;
      });
    },
    createBook: (array) => {
      const [book, id, image] = array;
      if (
        book["read"] === "book read" ||
        book["read"] === "You've read this book"
      )
        queries.objects.book.dataset.read = "";
      queries.objects.book.querySelector(".genres").innerHTML =
        queries.objects.bookSnapshot.querySelector(".genres").innerHTML;
      queries.objects.book.id = queries.objects.book.querySelector(
        ".cover"
      ).title = id;
      queries.objects.book.querySelector(".cover-title").textContent = id;
      queries.objects.book.querySelector(".cover-image").src = image;
      queries.fillBookdetails(queries.objects.book, book);
      Array.from(queries.objects.book.querySelectorAll(".editable")).forEach(
        (item) => {
          item.addEventListener("click", queries.editDetails);
        }
      );
    },
    deleteBook: (event) => {
      if (!event.target === queries.objects.delete) return;
      const key = queries.objects.book.id;
      library.removeChild(
        queries.objects.library.querySelector(`[title="${key}"]`)
      );
      pubsub.publish("deleteBook", `${key}`);
      queries.objects.libraryAnchor.click();
      queries.objects.book.id = "";
    },
    init: () => {
      queries.objects.navAnchor.click();
      queries.objects.form.addEventListener("submit", queries.getData);
      queries.objects.delete.addEventListener("click", queries.deleteBook);
      queries.objects.marker.addEventListener("click", queries.markAsRead);
      queries.objects.reader.addEventListener("load", queries.extractURL);
      pubsub.subscribe("createAnchor", queries.createAnchor);
      pubsub.subscribe("fillDetails", queries.fillBookdetails);
      pubsub.subscribe("deleteBook", Book.deleteBook);
      pubsub.subscribe("setDetail", Book.setDetail);
      Book.initBooks();
    },
  };
  queries.init();
})();
